import { NavLink } from "react-router-dom";
import s from "./NavLinks.module.scss";
import {
  AiOutlineHome,
  AiOutlineFundProjectionScreen,
  AiOutlineUser,
} from "react-icons/ai";

import { FcContacts, FcDocument } from "react-icons/fc";

import { routes } from "../../../routes/BaseRoutes";

const NavLinks = () => {
  return (
    <ul className={s.navBar}>
      <li>
        <NavLink to={routes.HOME} activeClassName={s.active} exact>
          <AiOutlineHome />
          Home
        </NavLink>
      </li>

      <li>
        <NavLink to={routes.ABOUT} activeClassName={s.active}>
          <AiOutlineUser />
          About
        </NavLink>
      </li>

      <li>
        <NavLink to={routes.PROJECTS} activeClassName={s.active}>
          <AiOutlineFundProjectionScreen />
          Projects
        </NavLink>
      </li>

      <li>
        <NavLink to={routes.RESUME} activeClassName={s.active}>
          <FcDocument />
          Resume
        </NavLink>
      </li>

      <li>
        <NavLink to={routes.CONTACT} activeClassName={s.active}>
          <FcContacts />
          Contact
        </NavLink>
      </li>
    </ul>
  );
};

export default NavLinks;
